import React from "react";
import { Container, Col, Row, Button } from "reactstrap";

const ExpandedCrop = (props) => {
	if (props.crop) {
		return (
			<Container fluid className='contant-container'>
				<h1>{props.crop}</h1>
			</Container>
		);
	} else {
		return null;
	}
};

export default ExpandedCrop;
